                        title="Infographie"
                        descriptions="Illustrator | Photoshop"/>
                    <Checklist
                        title="Etiquettage/Packaging"
                        descriptions="Illustrator | Photoshop"/>
                </div>
                {/*<div className="col-lg d-flex justify-content-center">
                    <img src={Plume} alt="#" style={{height: 655}}/>
                </div>*/}
            </div>
        </div>
    )
};
